chrisadams3997/rrp-pasture-flora:
  authors:
    - bsc
  categories: mmps,flora,props
  description: |-
    This pack contains a wide variety of mayor mode flora to enhance your terrains in rural and urban settings.

    They can be found in the middle of the mayor mode menu.

    All the models have been placed into one file but the dats for the different types of ploppable flora have been kept separate so if there are any that you do not want to use you may remove the dats for them. You MUST, however, keep ALN_Pasture Flora.dat as without that you will have brown boxes.

    I would strongly suggest to remove any of previous version of RRP or Pasture Flora before installing the last version, some files are incompatible. In addition, if you used an earlier version of the Pasture Flora and now you wants to use the new one, you must bulldoze all old plants, otherwise the city will not open after replacing an old version by the new one. It can be difficult in an existing city where old grasses were used extensively - but it is necessary.
